Tsukihime
Company: Type-Moon
Release date: Dec 29, 2000

Summary: The story begins in a recollection of a boy called Shiki in his childhood years. There he gains a power out of this world. What is the meaning of this power, and what can he do with it? This is his story of finding the missing pieces of the puzzle. 



